import React from 'react';
import MessageList from './MessageList';
import SendMessageForm from './SendMessageForm';
import Title from './Title';

class App extends React.Component {

  constructor() {
    super()
    this.state = {
      messages: DUMMY_DATA
    }
  }

  render() {
    DUMMY_DATA = [
      {
        senderId: "perborgen",
        text: "who'll win?"
      },
      {
        senderId: "janedoe",
        text: "who'll wil?"
      }
    ]

    return (
      <div>
        <Title />
        <MessageList messages={this.state.messages} />
        <SendMessageForm />
      </div>
    );
  }
}

export default App;
